import React, {useState} from 'react';
import "./ChatBot.css";

export default function ChatBot() {
    const [isOpen, setIsOpen] = useState(true);

    function closeChat() {
        setIsOpen(!isOpen);
    }

    return(
        <div className="chatbot">
            {isOpen? <button type="button" className="btn-close close-btn" aria-label="Close" onClick={closeChat}></button> : ".chatbot close"}

        </div>
    )
}
